Sweet Sinema revisits the classic tale of lust, head games and power play in 6 1/2 Weeks, starring beautiful blonde Inari Vachs and gorgeous leading man Manuel Ferrara. Inari is a lovely but reserved party planner who meets the mysterious Manuel at an art gallery. When he notices her admiring a painting of a melancholy woman, he uses it as an opening to meet the curvy blonde. Inari is immediately intrigued by this suave, successful stranger, and she falls for him quickly. But Manuel has a secret dark side, and Inari soon learns the sexual and psychological perversions to which she must submit to keep his love. Will their sick game go too far?
